scriptlet.script:
// This template shows how to access operation return data, inputs and context data 
// and how to set context data, responses and results. 

// To get value associated with the context key myContextKey: 
query_results = scriptletContext.get("query_results"); 
queryCount = scriptletContext.get("queryCount");
nombre_query = scriptletContext.get("nombre_query");
fecha_proceso = scriptletContext.get("fecha_proceso");

var d = new Date();
var curr_date = d.getDate();
var curr_month = d.getMonth()+1;
var curr_year = d.getFullYear();
var UID_FECHA_PROCESO = curr_year+"-"+curr_month+"-"+curr_date;

var insert="";

if(nombre_query == 'OPNACIONAL'){
	insert+="INSERT INTO TBL_RED_USO_INFRA_DIARIO (UID_FECHA_PROCESO,UID_BAN_CODIGO_BANCO,UID_CODIGO_BANCO,UID_RETIROS,UID_CONS,UID_NIPS,UID_DESCRIPCION,UID_FECHA_CARGA,UID_SERVICIO) VALUES ";
}
if(nombre_query == 'RECH'){
	insert+="INSERT INTO TBL_RED_USO_INFRA_DIARIO (UID_FECHA_PROCESO,UID_BAN_CODIGO_BANCO,UID_CODIGO_BANCO,UID_TOTAL_TNX,UID_DESCRIPCION,UID_FECHA_CARGA,UID_SERVICIO) VALUES ";
}
if(nombre_query == 'VENT_GENT'){
	insert+="INSERT INTO TBL_RED_USO_INFRA_DIARIO (UID_FECHA_PROCESO,UID_CODIGO_BANCO,UID_BAN_CODIGO_BANCO,UID_TOTAL_TNX,UID_IMPORTE_TOTAL,UID_DESCRIPCION,UID_FECHA_CARGA,UID_SERVICIO) VALUES ";
}
if(nombre_query == 'VG_EGLO'){
	insert+="INSERT INTO TBL_RED_USO_INFRA_DIARIO (UID_FECHA_PROCESO,UID_CODIGO_BANCO,UID_BAN_CODIGO_BANCO,UID_CODIGO_TIPO_MENSAJE,UID_TOTAL_TNX,UID_DESCRIPCION,UID_FECHA_CARGA,UID_SERVICIO) VALUES ";
}
if(nombre_query == 'EGLO_EMI'){
	insert+="INSERT INTO TBL_RED_USO_INFRA_DIARIO (UID_FECHA_PROCESO,UID_BAN_CODIGO_BANCO,UID_CODIGO_BANCO,UID_TOTAL_TNX,UID_DESCRIPCION,UID_FECHA_CARGA,UID_SERVICIO) VALUES ";
}
if(nombre_query == 'EGLO_ADQ'){
	insert+="INSERT INTO TBL_RED_USO_INFRA_DIARIO (UID_FECHA_PROCESO,UID_CODIGO_BANCO,UID_BAN_CODIGO_BANCO,UID_TOTAL_TNX,UID_DESCRIPCION,UID_FECHA_CARGA,UID_SERVICIO) VALUES ";
}
if(nombre_query == 'VISA_CS'){
	insert+="INSERT INTO TBL_RED_USO_INFRA_DIARIO (UID_FECHA_PROCESO,UID_BAN_CODIGO_BANCO,UID_CODIGO_BANCO,UID_CODIGO_TIPO_MENSAJE,UID_TOTAL_TNX,UID_DESCRIPCION,UID_FECHA_CARGA,UID_SERVICIO) VALUES ";
}
if(nombre_query == 'VISA_SS'){
	insert+="INSERT INTO TBL_RED_USO_INFRA_DIARIO (UID_FECHA_PROCESO,UID_BAN_CODIGO_BANCO,UID_CODIGO_BANCO,UID_RETIROS,UID_CONS,UID_NIPS,UID_RECH,UID_DESCRIPCION,UID_FECHA_CARGA,UID_SERVICIO) VALUES ";
}
if(nombre_query == 'MDS'){
	insert+="INSERT INTO TBL_RED_USO_INFRA_DIARIO (UID_FECHA_PROCESO,UID_BANCO_EMI,UID_BANCO_ADQ,UID_CLAVE_OPERACION,UID_CODIGO_TIPO_MENSAJE,UID_TOTAL_TNX,UID_DESCRIPCION,UID_FECHA_CARGA,UID_SERVICIO) VALUES ";
}

if(queryCount > 0){
	linea = query_results.split("\n");
	for(i=0; i < linea.length; i++){
	    if(i>0) { insert+=" , "; }
	    linea_insert = linea[i].replace(" 00:00:00","");

		if(nombre_query == 'OPNACIONAL'){
			insert+='("'+fecha_proceso+'",'+linea_insert+')';
		}
		if(nombre_query == 'RECH'){
					insert+='("'+fecha_proceso+'",'+linea_insert+')';
		}
		if(nombre_query == 'VENT_GENT'){
					insert+='("'+fecha_proceso+'",'+linea_insert+')';
		}
		if(nombre_query == 'VG_EGLO'){
					insert+='("'+fecha_proceso+'",'+linea_insert+')';
		}
		if(nombre_query == 'EGLO_EMI'){
					insert+='("'+fecha_proceso+'",'+linea_insert+')';
		}
		if(nombre_query == 'EGLO_ADQ'){
					insert+='("'+fecha_proceso+'",'+linea_insert+')';
		}
		if(nombre_query == 'VISA_CS'){
					insert+='("'+fecha_proceso+'",'+linea_insert+')';
		}
    	if(nombre_query == 'VISA_SS'){
					insert+='("'+fecha_proceso+'",'+linea_insert+')';
		}
		if(nombre_query == 'MDS'){
					insert+='("'+fecha_proceso+'",'+linea_insert+')';
		}			 
	} // fin for
	insert+=";";
} // fin if


// Use the context to hold data for use by other steps.  It is also helpful to place information 
// into the context to examine variables when developing and debugging scriptlets. 
// For example to place the OutputString information into a context key called 'Output': 
scriptletContext.putGlobal("INSERT_SENTENCE", insert); 

